import React from 'react'
import { Link } from 'react-router-dom';
const Navigation = () => {
  return (
    <>
        <nav
            style={{
                borderBottom: "solid 1px",
                paddingBottom: "1rem",
            }}
            >
            <Link to="/" exact>Home</Link>
            <Link to="/coolstuff">stuff</Link>
            <Link to="techstacks">stax</Link>
        </nav>
    </>
  )
}

export default Navigation
